import React, { useState } from 'react';
import './App.css';
import post from './Post';
import Post from './Post';

function App() {
  const [posts, setPosts] = useState([
    {
      username: "christiane",
      caption: "Nice!",
      imageUrl: "https://user-images.githubusercontent.com/59893406/109395744-0374a580-78fc-11eb-81bd-fb7197ff13ba.png"
    },  
    {
      username: "christiane",
      caption: "Nice!",
      imageUrl: "https://user-images.githubusercontent.com/59893406/109395744-0374a580-78fc-11eb-81bd-fb7197ff13ba.png"
    }
  ]);
  


  return (
  <div className="Application">

    <div className="header">

      <div className="Instafeed">
        <h1>Instafeed</h1>
      </div>

      <img className="app__headerImage" src="https://user-images.githubusercontent.com/59893406/109395744-0374a580-78fc-11eb-81bd-fb7197ff13ba.png" alt="" />

      <div className= "search">
      
      <input type="text" placeholder="Search.."/>
      </div>

    </div>

    {
      posts.map(post => (
        <Post username={post.username} caption={post.caption} imageUrl={post.imageUrl} />
      ))
    }


  
  
  </div>
  );
}

export default App;
